import '../css/App.css';

const SideNav = ({ list, currentTab, setTab }) => {
	const tabItems = Object.keys(list)
	return (
		<footer className="App-sideNav">
			{tabItems.map(tab => (
				<button
					class={`tab${currentTab === tab ? ' selected' : ''}`}
					onClick={() => setTab(tab)}
				>
					{tab}
				</button>
			))}
		</footer>
	);
}

export default SideNav;
